const DateContainer = () => {
  const month = ["January", "February", "March", "April", "May", "June", 
  "July", "August", "September", "October", "November", "December"];

  return (
    <div id="date-container">
      <select>{month.map(createMonthsOptions)}</select>
      <select></select>
      <select></select>
    </div>
  )
}


function createMonthsOptions(element, index) {
  return <option value={index + 1}>{element}</option>;
}

export default DateContainer;
